@jose maria além do mais...o STF não proibio o Bolsonaro de agir frente a covid...isso é uma mentira replicada por ele. Eles atribuíram a governos de estados e gestores de municípios papéis competitivos frente ao governo federal...em outras palavras, caso o governo federal não tomasse a frente para uma ação conjunta, cada estado poderia agir conforme julgasse mais adequado para garantir a integridade da sua população. Simples e constitucional, já que se baseia no fato de que é dever do estado garantir e assegurar o acesso a uma "saúde de qualidade". Isso é tão fato, que agora depois do caos, e de se aproximarem as eleições federais, o "presidente" mudou de postura e resolveu partir pra ação conjunta, via um "comitê covid"
Vai saber como a cabeça de um sociopata com traços de pscicopatia funciona, não é msmo?! 
Mas se eu estiver errado, me aponte onde e por quê...ficarei muito satisfeito em analisar isso...

